
#SHORT NUMBERS n1
NUMBERS = [
352358118079150493187099355141629527101749106167997255509619020528333722352217]

#LONG NUMBERS n2
NNUMBERS = []
import math
v = 0
n = NNUMBERS[v]
print("n2 = ", n)
dividers = []

for num in NUMBERS:
	gcd = math.gcd(n,num)
	if gcd != 1 and gcd != n:
		print("from numbers is ", gcd)
		dividers.append(gcd)

for nnum in NNUMBERS:
	gcd = math.gcd(n, nnum)
	if gcd != 1 and gcd != n:
		print("from nnumbers is", gcd)
		dividers.append(gcd)
for div in dividers:
	print("factor1 = ", div)
	print("factor2 = ", n // div)
